	enemy:AddEnemy(5);
	enemy:AddEnemy(2);
	enemy:NewEnemyParty();
	enemy:AddEnemy(5);
	enemy:AddEnemy(5);
	-- Add the enemy to the zone two times (it also gets added to the ground objects) 
